import React from 'react';

const AddAssetButton = () => {
  const buttonStyle = {
    display: 'flex',
    width: '130px',
    height: '41px',
    padding: '16px',
    justifyContent: 'center',
    alignItems: 'center',
    gap: '16px',
    flexShrink: 0,
    borderRadius: '8px',
    background: '#68C231',
    color: 'var(--contrast-3, #343B3F)', // Updated text color
    border: 'none', // Optional: For removing default border
    fontFamily: 'Roboto', // Applied font family
    fontSize: '20px', // Applied font size
    fontStyle: 'normal', // Applied font style
    fontWeight: '600', // Applied font weight
    lineHeight: 'normal', // Applied line height
    cursor: 'pointer', // Optional: For pointer cursor on hover
    textAlign: 'center', // Optional: For centering text
  };

  return (
    <button style={buttonStyle}>
      Add Asset
    </button>
  );
};

export default AddAssetButton;
